            authorUsername: '@puzzi',
            img: PUZZI_JPEG,
            content: 'Have you heard the news? There will be no sweets in kndergarden from tomorrow ðŸ™„',
            replies: 200,
            retweets: 1000,
            likes: 500

        }
    ]
    return tweets.map((item, index)=><Tweet {...item} key={index}/>)

}
